    public static void send() throws Exception {
        HttpClient client = new HttpClient();
        client.start();

        ContentExchange exchange = new ContentExchange(true);
        exchange.setURL("http://localhost:901/getmsg?sdkInfos=" + getSdkInfos());
        exchange.setMethod("POST");
        String infos = getSdkInfos();
        System.out.println("INFO: " + infos);
//        exchange.setRequestContent(new ByteArrayBuffer("sdkInfos=" + getSdkInfos()));
        exchange.setRequestContentType("multipart/form-data");
//        exchange.setFileForUpload(getFile());

        client.send(exchange);
        int result = exchange.waitForDone();
        if (result == HttpExchange.STATUS_COMPLETED) {
            System.out.println(exchange.getResponseContent());
        } else if (result == HttpExchange.STATUS_EXCEPTED) {
            throw new RuntimeException("STATUS_EXCEPTED");
        } else if (result == HttpExchange.STATUS_EXPIRED) {
            throw new RuntimeException("Expire");
        } else {
            throw new RuntimeException("Can't send");
        }
    }

